prompt --application/shared_components/logic/application_computations/insert_manually_into_int_grid
begin
wwv_flow_imp_shared.create_flow_computation(
 p_id=>wwv_flow_imp.id(13208077717711127)
,p_computation_sequence=>10
,p_computation_item=>'INSERT_MANUALLY_INTO_INT_GRID'
,p_computation_point=>'AFTER_SUBMIT'
,p_computation_type=>'STATIC_ASSIGNMENT'
,p_computation_processed=>'REPLACE_EXISTING'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'begin  ',
'     case :APEX$ROW_STATUS  ',
'     when ''I'' then -- Note: In EA2 this has been changed from I to C for consistency with Tabular Forms  ',
'         insert into emp ( empno, ename, deptno )  ',
'         values ( :EMPNO, :ENAME, :DEPTNO )  ',
'         returning rowid into :ROWID;  ',
'     when ''U'' then  ',
'         update emp  ',
'            set ename  = :ENAME,  ',
'                deptno = :DEPTNO  ',
'          where rowid  = :ROWID;  ',
'     when ''D'' then  ',
'         delete emp  ',
'         where rowid = :ROWID;  ',
'     end case;  ',
'end;  '))
);
end;
